import React from "react";
import { GlobalStyles } from "../../styles/GlobalStyles";
import { Header, Title } from "./styles";

const Layout = (props) => {
  return (
    <>
      <GlobalStyles />
      <Header>
        <Title>Social Media Dashboard</Title>
      </Header>
    </>
  );
};
export default Layout;
